	dup52 = 2*CB*MW*SW*UASfC(All3,3 + gno2,2)*
     &     ZNeuC(Neu3,1) + 
     &    CW*Mf(2,gno2)*UASfC(All3,gno2,2)*ZNeuC(Neu3,3)

	dZfR1(2,gno2,gno1) = 
     &   dZfR1(2,gno2,gno1) + 
     &    1/(4.D0*Pi)*(AlfaMZ*
     &        ((dup51*dup52*Mf(2,gno1) + dup49*dup50*Mf(2,gno2))*
     &           MNeu(Neu3)*
     &           Re(B0(Mf2(2,gno1),MASf2(All3,2),MNeu2(Neu3))) + 
     &          (dup50*dup51*Mf(2,gno1)*Mf(2,gno2) + 
     &             dup49*dup52*Mf2(2,gno1))*
     &           Re(B1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2)))))/
     &      (CB2*CW2*MW2*SW2*(Mf2(2,gno1) - Mf2(2,gno2)))

	ENDLOOP(Neu3)
	ENDLOOP(All3)

#ifdef DETAILED_DEBUG
	DCOUP "hee-RenConst: dZfR1(2,gno2,gno1) =", dZfR1(2,gno2,gno1) ENDL
#endif

	endif

	ENDLOOP(gno1)

	ENDLOOP(gno2)

	end

